import ReactDOM from 'react-dom';
import './index.css';

function App() {
    return (
      <Router>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/cart" component={Cart} />
        </Switch>
      </Router>
    );
  }

  ReactDOM.render(<App />, document.getElementById('root'));
